import {IDrawingState} from './Drawing';
import {ChartAccessorService} from '../../../services/chart';
import {TrendLineAlert, TrendLineAlertDrawingDefinition} from '../../../services/data/alert';
import {Interval} from '../../../services/loader';
import {IntervalUtils} from '../../../utils/interval.utils';
import {AxisScaleType} from '../Scales/axis-scale-type';
import {ChartEvent} from '../../StockChartX/Chart';
import {ChartPoint, IPoint} from '../../StockChartX/Graphics/ChartPoint';
import {BrowserUtils} from '../../../utils';
import {ThemedDrawing} from './ThemedDrawing';
import {DrawingTheme} from './DrawingThemeTypes';
import {Config} from '../../../config/config';
import {ThemeType} from '../ThemeType';
import {MathUtils} from '../../../utils/math.utils';

export abstract class AlertableDrawing<T extends DrawingTheme> extends ThemedDrawing<T> {

    private _bellImage = new Image();
    private _achievedBellImage = new Image();
    private _updateAlertTimeoutHandle: number = null;

    loadState(state: IDrawingState) {
        super.loadState(state);
        if(this._bellImage) {
            this._bellImage.src = this.chart.getThemeType() == ThemeType.Light ?
                "data:image/png;base64,":
                "data:image/png;base64,";
        }
        if(this._achievedBellImage) {
            this._achievedBellImage.src = this.chart.getThemeType() == ThemeType.Light ?
                "data:image/png;base64," :
                "data:image/png;base64,";
        }


    }

    protected finishedDragging() {
        super.finishedDragging();

        let trendLineAlert = ChartAccessorService.instance.getAlertService().getTrendLineAlertByDrawingId(this.id);
        if(trendLineAlert == null) {
            return;
        }

        if(this._updateAlertTimeoutHandle) {
            clearTimeout(this._updateAlertTimeoutHandle);
            this._updateAlertTimeoutHandle = null;
        }

        let newAlert = this.createTrendLineAlert();
        if(trendLineAlert.hasDifferentTrendLineDefinition(newAlert.trendLine)) {
            trendLineAlert.updateTrendLineDefinitionAndInterval(newAlert.trendLine, newAlert.interval);
            this._updateAlertTimeoutHandle = window.setTimeout(() => {
                this.chart.fireValueChanged(ChartEvent.UPDATE_TREND_LINE_ALERT, trendLineAlert);
            }, 2000);
        }
    }

    preDeleteCleanUp() {
        super.preDeleteCleanUp();
        let trendLineAlert = ChartAccessorService.instance.getAlertService().getTrendLineAlertByDrawingId(this.id);
        if(trendLineAlert != null) {
            this.chart.fireValueChanged(ChartEvent.DELETE_ALERT, {alertId: trendLineAlert.id, shouldConfirm: false});
        }
    }

    addOrEditAlert():void {
        let alert = ChartAccessorService.instance.getAlertService().getTrendLineAlertByDrawingId(this.id);
        if(this.chartPanel != this.chart.mainPanel) {
            this.chart.fireValueChanged(ChartEvent.UNSUPPORTED_TREND_LINE_ALERT_PANEL);
        } else if(alert == null) {
            this.chart.fireValueChanged(ChartEvent.SHOW_TREND_LINE_ALERT_DETAILS, this.createTrendLineAlert());
        } else {
            this.chart.fireValueChanged(ChartEvent.SHOW_TREND_LINE_ALERT_DETAILS, alert);
        }
    }

    protected drawAlertBellIfNeeded() {
        if(Config.isElementBuild()) {
            return; // no alerts for element build
        }
        let hasActiveAlert = ChartAccessorService.instance.getAlertService().getTrendLineAlertByDrawingId(this.id) != null;
        let hasAchievedAlert = ChartAccessorService.instance.getAlertService().getAchievedTrendLineAlertByDrawingId(this.id) != null;
        if(hasActiveAlert) {
            this.drawAlertBell(false);
        } else if(hasAchievedAlert) {
            this.drawAlertBell(true);
        }
    }

    private drawAlertBell(achieved: boolean) {
        let image = achieved ? this._achievedBellImage : this._bellImage,
            context = this.context;

        let point = this.getAlertIconPoint();

        context.drawImage(image, point.x - (image.width / 2), point.y + 7);
    }


    canAddAlerts() : boolean {
        return BrowserUtils.isDesktop(); // MA only show alert for desktop
    }

    createTrendLineAlert(): TrendLineAlert {
        let drawingId: string = this.id;
        let symbol = this.chart.instrument.symbol;
        let company = ChartAccessorService.instance.getCompanyBySymbol(symbol);
        let interval = Interval.fromChartInterval(this.chart.timeInterval);

        return TrendLineAlert.createNewAlert(interval.type, company, this.getTrendLineAlertDefinition(interval),
            this.chart.hostId, drawingId, ChartAccessorService.instance.isArabic() ? 'arabic' : 'english');

    }

    // MA interval can be different than the current chart interval, as in comparing trend line alert definition with the current saved one
    // for the original interval for which saved alert was added (used for testing the integrity of saved alerts and the ability
    // to map them correctly to chart alerts).
    getTrendLineAlertDefinition(interval:Interval):TrendLineAlertDrawingDefinition{

        let firstChartPoint = this.getAlertFirstChartPoint();
        let secondChartPoint = this.getAlertSecondChartPoint();

        let symbol = this.chart.instrument.symbol;
        let market = ChartAccessorService.instance.getMarketBySymbol(symbol);
        let date1 = IntervalUtils.getGroupingTime(market.abbreviation, interval, moment(firstChartPoint.date).format('YYYY-MM-DD HH:mm:ss'));
        let date2 = IntervalUtils.getGroupingTime(market.abbreviation, interval, moment(secondChartPoint.date).format('YYYY-MM-DD HH:mm:ss'));
        let price1 = MathUtils.roundAccordingMarket(firstChartPoint.value, this.chart.instrument.symbol);
        let price2 = MathUtils.roundAccordingMarket(secondChartPoint.value, this.chart.instrument.symbol);
        let logarithmic = this.chartPanel.getAxisScale() == AxisScaleType.Logarithmic;

        if(Interval.isDaily(interval)) {
            date1 = `${date1} 00:00:00`;
            date2 = `${date2} 00:00:00`;
        }

        let extendsLeft: boolean = this.canAlertExtendLeft();
        let extendsRight: boolean = this.canAlertExtendRight();

        return {
            date1: date1,
            date2: date2,
            price1: price1,
            price2: price2,
            extendLeft: extendsLeft,
            extendRight: extendsRight,
            logarithmic: logarithmic
        };

    }

    protected getAlertIconPoint() : IPoint {
        return this.getAlertFirstChartPoint().toPoint(this.projection);
    }

    protected abstract canAlertExtendRight():boolean;
    protected abstract canAlertExtendLeft():boolean;
    protected abstract getAlertFirstChartPoint():ChartPoint;
    protected abstract getAlertSecondChartPoint():ChartPoint;


}
